/**
 * @param {string} s
 * @return {number}
 */

const isAllUnique = (str, start, end) => {
  // console.log('isAllUnique', start, end)
  const set = new Set()
  for (let i = start; i <= end; i++) {
      const c = str[i]
      if (set.has(c) == true) {
        return false
      }
    set.add(c)
  }
  return true
}

const lengthOfLongestSubstring = (s) => {
  const len = s.length
  let bestLen = s.length == 0 ? 0 : 1
  for (let i = 0; i < len; i++) {
    for (let j = i+1; j < len; j++) {
      const subLen = j - i + 1
      if (subLen <= bestLen) continue
      if (isAllUnique(s, i, j)) {
        if (subLen > bestLen) {
          bestLen = subLen 
        }
      }
    }
  }

  return bestLen
};

